import React, { Component } from 'react'
import BasePage from './BasePage';


export default class Authentication extends Component {

  constructor(props) {
    super(props);
    this.state = {
      isAuthenticated: false 
    };
  }

  render() {
    const { isAuthenticated } = this.state;
    return (
        <>
        <BasePage.js>
        <AuthentificationForm/>
        </BasePage.js>
        </>
    )
  }
}
